description:
Douglas Quaid is a factory worker with a beautiful wife living in a futuristic world where the majority of the earth has been rendered uninhabitable. For Quaid, Rekall (a process by which false memories are implanted into a subjects head) seems like just the &quot;getaway&quot; he needs. Quaid finds himself thrust into the midst of a global conspiracy when the procedure to implant a secret agent mission into his memory goes wrong - or does it? Written by ALystrup 

